script: |
  super -f text -I q9390.spq | sort > q9390.out

inputs:
  - name: q9390.spq
    data: |
      SELECT ALL + 20 FROM tab2 (FORMAT parquet) WHERE NOT ( col1 * - col1 / + + col2 + + col0 ) IN ( col2, + col2 );
  - name: tab2

outputs:
  - name: q9390.out
    data: |
      20
      20
      20
